function strcmp(str1, str2)
{
	return ((str1==str2) ? 0 : ((str1>str2) ? 1 : -1));
}

function wordExist(word)
{
	var l = 0;
	var r = data.word_count-1;
	var i = ~~(data.word_count/2);
	var strcmp_result;
	while((strcmp_result = strcmp(word, data.words[i].word))!=0) {
		if(strcmp_result < 0)
			r = i - 1;
		else
			l = i + 1;
		i = ~~((r-l)/2) + l;
		if(l>r)
			return -1;
	}
	return i;
}

const not_exist_pos = Math.log(1/(data.pos_sentence + 2.0*1));
const not_exist_neg = Math.log(1/(data.neg_sentence + 2.0*1));
function get_prob(category, word, store)
{	
	var index = wordExist(word);
	if(category == 1) {
		if(index == -1)
			return not_exist_pos;
		var i;
		var x=0;
		var max = store.posWordRank.length;
		for(i=0; i<max; ++i)
		{
			if(data.words[index].pos>store.posWordRankLogProb[i])
			{
				store.posWordRank.splice(i,0,word);
				store.posWordRankLogProb.splice(i,0,data.words[index].pos);
				x=1;
				break;
			}
		}
		if(x==0){
			store.posWordRank.push(word);
			store.posWordRankLogProb.push(data.words[index].pos);
		}
		return data.words[index].pos;
	}
	if(index == -1)
		return not_exist_neg;
	var i;
	var x=0;
	var max = store.negWordRank.length;
	for(i=0; i<max; ++i)
	{
		if(data.words[index].neg>store.negWordRankLogProb[i])
		{
			store.negWordRank.splice(i,0,word);
			store.negWordRankLogProb.splice(i,0,data.words[index].neg);
			x=1;
			break;
		}
	}
	if(x==0){
		store.negWordRank.push(word);
		store.negWordRankLogProb.push(data.words[index].neg);
	}
	
	return data.words[index].neg;
}

function filterWord(word, store, swords)
{
	var n = word.length;
	if(n<3 || n>31){
		if(n>0)
			store.wordsRemoved.push(word);
		return 0;
	}
	var stopwords;
	if ( typeof swords !== 'undefined' && swords )
		stopwords = swords;
	else
		stopwords = ["about", "after", "again", "against", "ain", "all", "also", "and", "any", "are", "aren", "because", "been", "before", "being", "between", "billion", "billions", "both", "but", "can", "cannot", "cant", "company", "could", "couldn", "did", "didn", "does", "doesn", "doing", "don", "during", "each", "eight", "eighty", "etc", "every", "everybody", "everyone", "everything", "everywhere", "few", "fifty", "five", "for", "four", "fourty", "from", "further", "furtherer", "furthermore", "had", "hadn", "has", "hasn", "have", "haven", "having", "her", "here", "hers", "herself", "him", "himself", "his", "how", "hundred", "hundreds", "into", "isn", "its", "itself", "just", "made", "make", "mightn", "million", "millions", "more", "most", "mustn", "myself", "needn", "nine", "ninety", "nor", "not", "now", "off", "once", "one", "only", "other", "our", "ours", "ourselves", "out", "over", "own", "said", "same", "seven", "seventy", "several", "shan", "share", "shares", "she", "should", "shouldn", "since", "six", "sixty", "some", "somebody", "somehow", "someone", "something", "sometime", "sometimes", "somewhere", "stock", "such", "ten", "tens", "than", "that", "the", "their", "theirs", "them", "themselves", "then", "there", "these", "they", "thirty", "this", "those", "thousand", "thousands", "three", "through", "too", "trillion", "trillions", "twenty", "two", "under", "until", "very", "was", "wasn", "were", "weren", "what", "whatever", "when", "where", "whereafter", "whereby", "wheresoever", "wherever", "which", "whichever", "whichsoever", "while", "who", "whoever", "whom", "whomever", "whose", "whoso", "whosoever", "why", "will", "with", "within", "without", "won", "would", "wouldn", "year", "years", "you", "your", "yours", "yourself", "yourselves", "zero"];
	// added company, stock, share, shares, year, years
	n = stopwords.length;
	var l = 0;
	var r = n-1;
	var i = ~~(n/2);
	var strcmp_result;
	while((strcmp_result = strcmp(word, stopwords[i]))!=0) {
		if(strcmp_result < 0)
			r = i - 1;
		else
			l = i + 1;
		i = ~~((r-l)/2) + l;
		if(l>r){
			store.wordsTested.push(word);
			return 1;
		}
	}
	store.wordsRemoved.push(word);
	return 0;
}

function test_prob(results, test_str, store, swords)
{
	var data_word_size = 0;
	var data_word = [];
	const regex = /[^A-Za-z ]/g;
	var temp_str = test_str.replace(regex, " ");
	var pre_lc = temp_str.toLowerCase();
	var nonunique = pre_lc.split(" ");
	var field = [...new Set(nonunique)];
	for(const str of field) {
		if(filterWord(str, store, swords)) {
			data_word.push(str);
			++data_word_size;
		}
	}
	for(var i=0; i<data_word_size; ++i) {
		results.positive += get_prob(1, data_word[i], store);
		results.negative += get_prob(0, data_word[i], store);
	}
	store.negativeLogProb = results.negative;
	store.positiveLogProb = results.positive;
	//store.negWordRank = store.negWordRank.slice(0,5);
	//store.negWordRankLogProb = store.negWordRankLogProb.slice(0,5);
	//store.posWordRank = store.posWordRank.slice(0,5);
	//store.posWordRankLogProb = store.posWordRankLogProb.slice(0,5);
}

function naive_bayes(test_str, store, swords)
{
	var prob = {positive:Math.log((data.pos_sentence)/(data.pos_sentence+data.neg_sentence)), negative:Math.log((data.neg_sentence)/(data.pos_sentence+data.neg_sentence))};
	test_prob(prob, test_str, store, swords);
	if(prob.positive > prob.negative)
		return true;
	return false;
}

app.use(express.json());

app.get('/', (req,res) => {
	res.json("Try accessing /simple or /detailed");
});

app.post('/simple', (req,res) => {
	var response = [];
	var text = req.body.text;
	var stopwords = req.body.stopwords;
	var customStopWords = false;
	if ( typeof stopwords !== 'undefined' && stopwords )
		customStopWords = true;
	var sentimentData = {wordsRemoved:[],wordsTested:[],posWordRank:[],negWordRank:[],posWordRankLogProb:[],negWordRankLogProb:[],positiveLogProb:0,negativeLogProb:0};
	var positiveResult = naive_bayes(text, sentimentData, stopwords);
	var negativeResult = !positiveResult;
	response.push({positiveResult,negativeResult,customStopWords});
	res.json(response);
	//res.sendStatus(200);
});

app.post('/detailed', (req,res) => {
	var response = [];
	var text = req.body.text;
	var stopwords = req.body.stopwords;
	var customStopWords = false;
	if ( typeof stopwords !== 'undefined' && stopwords )
		customStopWords = true;
	var sentimentData = {wordsRemoved:[],wordsTested:[],posWordRank:[],negWordRank:[],posWordRankLogProb:[],negWordRankLogProb:[],positiveLogProb:0,negativeLogProb:0};
	var positiveResult = naive_bayes(text, sentimentData, stopwords);
	var negativeResult = !positiveResult;
	delete sentimentData.posWordRankLogProb;
	delete sentimentData.negWordRankLogProb;
	response.push({positiveResult,negativeResult,customStopWords,sentimentData});
	res.json(response);
	//res.sendStatus(200);
});

app.listen(PORT, () => console.log(`Server is running on PORT ${PORT}`));
